import React, { useState } from "react";
import emailjs from "@emailjs/browser";
import "./Contact.css";

const Contact = () => {
  const [form, setForm] = useState({
    name: "",
    email: "",
    subject: "",
    message: ""
  });

  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);

    const templateParams = {
      name: form.name,
      email: form.email,
      subject: form.subject,
      message: form.message
    };

    emailjs
      .send(
        "service_x2sy4ov",      // your service ID
        "template_2mtyx2p",     // your template ID
        templateParams,
        "1_0YGRViezqRkyJFD"     // your public key
      )
      .then(() => {
        alert("‚úÖ Message sent successfully!");

        setForm({
          name: "",
          email: "",
          subject: "",
          message: ""
        });

        setLoading(false);
      })
      .catch((error) => {
        console.error(error);
        alert("‚ùå Failed to send message");
        setLoading(false);
      });
  };

  return (
    <div className="contact-page">
      <div className="container">

        {/* Header */}
        <div className="contact-header">
          <h1 className="contact-title">Get in Touch</h1>
          <p className="contact-subtitle">
            Have questions about HK DEALERS? We're here to help you.
          </p>
        </div>

        {/* Contact Cards */}
        <div className="contact-cards">

          <div className="contact-card">
            <div className="card-icon">üìß</div>
            <h3>Email Us</h3>
            <a href="mailto:himanshu982472@gmail.com">
              himanshu982472@gmail.com
            </a>
          </div>

          <div className="contact-card">
            <div className="card-icon">üìû</div>
            <h3>Call Us</h3>
            <a href="tel:+9779824722712">
              +977 9824722712
            </a>
          </div>

        </div>

        {/* Contact Form */}
        <div className="contact-form-section">
          <div className="form-card">

            <h2>Send us a Message</h2>

            <form onSubmit={handleSubmit} className="contact-form">

              <div className="form-group">
                <label>Full Name *</label>
                <input
                  type="text"
                  name="name"
                  value={form.name}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="form-group">
                <label>Email *</label>
                <input
                  type="email"
                  name="email"
                  value={form.email}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="form-group">
                <label>Subject *</label>
                <input
                  type="text"
                  name="subject"
                  value={form.subject}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="form-group">
                <label>Message *</label>
                <textarea
                  name="message"
                  value={form.message}
                  onChange={handleChange}
                  rows="5"
                  required
                />
              </div>

              <button type="submit" className="submit-btn" disabled={loading}>
                {loading ? "Sending..." : "Send Message"}
              </button>

            </form>

          </div>
        </div>

      </div>
    </div>
  );
};

export default Contact;
